import Navbar from "./components/navbar/Navbar";
import "./app.css";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
import Registration from "./components/autorisation/Registration";
function App() {
  return (
    <BrowserRouter>
      <div className='app'>
        <Navbar />
        <Rou>
          <Route
            path='/registration'
            component={Registration}
          />
        </Rou>
      </div>
    </BrowserRouter>
  );
}

export default App;
